// 			))}
// 		</ul>
// 	);
// };
const MyList = ({ data }) => {
	console.log('renderizando lista');
	return (
		<ul>
			{data.map((x) => (
				<Li key={x.name + x.lastname}>
					{x.name} {x.lastname}
				</Li>
			))}
		</ul>
	);
};

export default MyList;
